exports=async function(url,bid,cid,options){const{parseContent,trimContentFragment,googleAdPattern}=await require("transcode/parse_content");return parseContent(url,{cleaner:html=>trimContentFragment(html,/id="contentbox"[^>]*>/)},{clientOptions:{...(options&&options.clientOptions)},webview:!0,preprocess:html=>html.replace(googleAdPattern,"")})};